-- 导出  表 znkf-shop.shop_order 结构
CREATE TABLE IF NOT EXISTS `shop_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `commodity_id` varchar(45) NOT NULL,
  `order_status` smallint(6) NOT NULL COMMENT '订单状态 0待付款1 待发货2待收货3待评价',
  `consignee` varchar(64) NOT NULL COMMENT '收货人',
  `mobile` varchar(64) NOT NULL COMMENT '手机号',
  `address` varchar(255) NOT NULL COMMENT '收货地址',
