  `freight_price` decimal(10,2) DEFAULT NULL COMMENT '配送费用',
  `coupon_price` decimal(10,2) DEFAULT NULL COMMENT '优惠券减免',
  `integral_price` decimal(10,2) DEFAULT NULL COMMENT '用户积分减免',
  `order_price` decimal(10,2) DEFAULT NULL COMMENT '订单费用， = goods_price + freight_price - coupon_price',
  `actual_price` decimal(10,2) DEFAULT NULL COMMENT '实付费用， = order_price - integral_price',
  `pay_id` varchar(45) DEFAULT NULL COMMENT '微信付款编号',
  `pay_status` smallint(6) DEFAULT NULL COMMENT '支付状态',
  `pay_time` datetime DEFAULT NULL COMMENT '微信付款时间',
  `color` varchar(45) DEFAULT NULL COMMENT '商品规格颜色',
  `size` varchar(45) DEFAULT NULL COMMENT '商品规格尺码',
  `pic` varchar(45) DEFAULT NULL COMMENT '商品规格图',
  `ship_sn` varchar(45) DEFAULT NULL COMMENT '发货编号',
  `ship_channel` varchar(45) DEFAULT NULL COMMENT '发货快递公司',
  `ship_start_time` datetime DEFAULT NULL COMMENT '发货开始时间',
  `ship_end_time` datetime DEFAULT NULL COMMENT '发货结束时间',
  `confirm_time` datetime DEFAULT NULL COMMENT '用户确认收货时间',
  `add_time` datetime DEFAULT NULL,
  `deleted` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='订单表';

